block0 Allows to provide initial addresses/voters which addresses would be put in block0. Supported syntax: above threshold Amount of wallets which receive more than value defined in static_data.voting_power parameter Example: { "above_threshold":30, "pin":"1234"
} Pin would be set globally for all 30 addresses below threshold Amount of wallets which receive less than value defined in static_data.voting_power parameter Example: { "below_threshold":30, "pin":"1234"
} Pin would be set globally for all 30 addresses around level Amount of wallets which have funds around defined level Example: { "count":30, "level":1000, "pin":"1234"
} zero funds Amount of wallets which won’t have any funds in block0 Example: { "zero_funds":30, "pin":"1234"
} named wallet Wallet with custom pin and arbitrary funds amount, Example: { "name":"darek", "funds":8000, "pin":"1111" }, external wallet Wallet with address and pin. For users who already generated address outside vitup. Example: { "address":"ca1qknqa67aflzndy0rvkmxhd3gvccme5637qch53kfh0slzkfgv5nwyq4hxu4", "funds":8000 }, snapshot Allows to provide initial addresses/voters which addresses would be put in initial snapshot. Supported syntax: random Some number of random wallets which receive specified amount of voting power Example: { "count": 2, "level": 5000 }, external A single entry with specified voting key and voting power Example: { "key":"3877098d14e80c62c071a1d82e3df0eb9a6cd339a5f66e9ec338274fdcd9d0f4", "funds":300 } named A single entry with specified alias from block0 and optional voting power. If voting power is not defined it would be taken from block0 section. If vitup cannot find alias it will produce an error Example: { "name": "darek", "funds": 100 },

